DELIMITER //
CREATE PROCEDURE add_perm_to_role(IN role VARCHAR(45), IN perm VARCHAR(45))
BEGIN
    DECLARE p, r INT default 0;
    select id into p from tPerm where code=perm;
    select id into r from tRole where code=role;
END;
